import "./product.css"
import tShirt from './t-shirt.jpeg';


function Product(props) {
    return (
      <div className="product">
        <div class="imgWrapper">
        <img class="productImg" src={tShirt}></img>
                </div>
                <div class="productInfo">
                    <div class="productName align-center">{props.name}</div>
                    <div class="productBrand align-center">{props.brand}</div>
                    <div class="productType align-center">{props.type}</div>
                    <div class="productPrice align-center">{props.price} $</div>
                </div>
      </div>
    );
  }


  export default Product;
